import React from "react";
import { Calendar, momentLocalizer } from 'react-big-calendar';
import moment from 'moment';
import 'react-big-calendar/lib/css/react-big-calendar.css';


const localizer = momentLocalizer(moment);

const events = [
    {
      title: 'Rendez-vous 1',
      start: new Date(2023, 6, 25, 10, 0), // année, mois (commence à 0 pour janvier), jour, heure, minute
      end: new Date(2023, 6, 25, 11, 0),
    },
    {
      title: 'Rendez-vous 2',
      start: new Date(2023, 6, 25, 14, 0),
      end: new Date(2023, 6, 25, 15, 30),
    },
    // Ajoutez d'autres rendez-vous ici
  ];
  
export default function CardCalendar(props) {

  return (
    <>
     <div>
            <Calendar
            localizer={localizer}
            events=""
            startAccessor="start"
            endAccessor="end"
            style={{ height: 500 }}
            />
     </div>
      
    </>
  );
}
